import { Button } from 'bootstrap';
import { BsSearch } from 'react-icons/bs';

function Searchbar()
{
  return (
    <>

      <input class="" type="text" placeholder="Search" />
      <button type="submit" class=" input-group-text"><BsSearch /></button>

    </>
  );
}

export default Searchbar;
